def preprocess_image(image):
    image=resize_image(image,.5)
    image=as_grayscale_image(image)
    image=cv_gauss_blur(image,5)
    image=auto_canny(image)
    image=cv_dilate(image,4,circular=True)
    return image
def get_contours(preprocessed_image):
    out=cv_find_contours(preprocessed_image)
    out=[x for x in out if cv_contour_area(x)>100 and not x.is_solid_white]
    out=[evenly_split_path(x,256,loop=True) for x in out]
    return out

def fft(x,n=20):
    out=np.fft.fft(x)
    out=np.concatenate((out[:n],out[:-n]))
    return out
def contour_descriptor(contour):
    contour=as_complex_vector(contour)
    contour=contour-contour.mean()
    contour=normalized(contour)
    concat= lambda *x:np.concatenate((*x,))
    out=           normalized(np.abs(fft(contour**1)))
    out=concat(out,normalized(np.abs(fft(contour**2))))
    out=concat(out,normalized(np.abs(fft(contour**3))))
    return normalized(out)

def best_contour_match_image(contour,number_of_matches=20):
    image=contour_to_image(contour)
    image=bordered_image_solid_color(image,(1,1,0,1),3)
    matches=flann_dict[contour_descriptor(contour):number_of_matches][0:]
    def pretty_contour_to_image(contour):
        out=as_rgba_image(full_range(contour_to_image(contour)))
        out=bordered_image_solid_color(out,(.5,0,0,1))
        return out
    matches_img=horizontally_concatenated_images(list(map(pretty_contour_to_image,matches)))
    image=horizontally_concatenated_images(image,matches_img)
    return image
def handpicked_matches_image():
    return vertically_concatenated_images([best_contour_match_image(contour)for contour in handpicked_contours])

flann_dict=FlannDict(checks=1500)
for contour in all_contours:
    flann_dict[contour_descriptor(contour)]=contour
print(end='Making im...')
im=handpicked_matches_image()
